import React from 'react'
import { Route } from 'react-router-dom'

const routes = [
    new Route({
      title: 'Home',
      path: '/Home/Home'
    }),
    new Route({
      title: 'Reporte',
      path: '/Reporte/Reporte'
    }),
    new Route({
      title: 'Registro',
      path: '/Registro/Registro'
    }),
    new Route({
       title: 'Log Out',
       path: '/Signup/Signup' 
    }),
    
  ]
  
  const NavbarItem = ({ route = new Route({ title: 'Inicio', path: '/' }) }) => (
    <li className="nav-item">
      <Link className="nav-link" href={route.path}>
        {route.title}
      </Link>
    </li>
  )
  
  const NavbarItemDropdown = ({ route = new Route({ title: '' }) }) => (
    <li className="nav-item dropdown">
      <a
        className="nav-link dropdown-toggle"
        role="button"
        data-bs-toggle="dropdown"
        aria-expanded="false">
        {route.title}
      </a>
      <ul className="dropdown-menu">
        {route.subRoutes.map((subRoute, index) => (
          <li key={`sub-route-${subRoute.path}`}>
            <Link
              className="dropdown-item"
              href={`${route.path}${subRoute.path}`}>
              {subRoute.title}
            </Link>
          </li>
        ))}
      </ul>
    </li>
  )
  

function Navbar() {
    return (
        <div className={styles.container}>
        <nav className="navbar navbar-expand bg-body-tertiary">
          <div className="container-fluid">
            <h1>RG</h1>
    
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              {routes.map((route) =>
                route.subRoutes.length > 0 ? (
                  <NavbarItemDropdown key={`route-${route.path}`} route={route} />
                ) : (
                  <NavbarItem key={`route-${route.path}`} route={route} />
                )
              )}
            </ul>
          </div>
        </nav>
        </div>
      )
}

export default Navbar
